Tom and Jerry Spotlight Collection, Vol.1 Disc.2

The Tom-and-Jerry legacy chases through every nook and cranny of the classic animation pantheon, spanning six decades and several famous directors. Looney Tunes icons Friz Freleng, Tex Avery and Chuck Jones all played their part. But the enduring cat-and-mouse team was the brainchild of William Hanna and Joseph Barbera. Their first short Puss Gets the Boot (in which Tom was called Jasper) was released with little fanfare. Fellow animators did not consider a cat-pursuing-mouse scenario too exciting or original. But when unleashed on exhibitors and audiences, their hilariously diabolical rivalry delighted everyone. This 2-disc set of 40 restored and remastered shorts includes nine Academy Award nominees and seven winners.   

